import React from "react";
import { Form } from "react-bootstrap";

const Footer = () => {
  return (
    <div style={{ backgroundColor: " #fbd062" }} className="row con d-flex">
      <div className="col-md-6 col-sm-12">
        <div className="ml-4 mt-5">
        <h1 >Let us handle your <br/>
           project, professionally</h1>
           <small>Lorem ipsum dolor sit amet consectetur adipisicing elit. Soluta itaque sunt officiis <br/> necessitatibus. Amet quam esse quis quod sed dicta?</small>
        </div>

      </div>
      <div className="col-sm-12 col-md-6 mt-5">
        <Form.Control
          style={{  height: "70px" }}
          type="text"
          id="inputPassword5"
          aria-describedby="passwordHelpBlock"
        /> <br/> <br/>
        <Form.Control
          style={{  height: "70px" }}
          type="text"
          id="inputPassword5"
          aria-describedby="passwordHelpBlock"
        /> <br/> <br/>
        <Form.Control
          style={{  height: "277px" }}
          type="text"
          id="inputPassword5"
          aria-describedby="passwordHelpBlock"
        />
      </div>
    </div>
  );
};

export default Footer;
